import React from 'react'
import s from './Header.module.css'
import { useNavigate } from 'react-router-dom';

const Header = (props) => {

    const navigate = useNavigate();

    const OnClick = () => {
        let copy = [...props.SelectedItem];
        copy[props.Id] = 0;
        SetSelectedItem(copy);
    }

    return (
        <div className={s.Header}>

            <div className={s.MainHeader}>
                <div className={s.WindowInfo}>
                    <img src={ props.WindowIcon }/>
                    <span className={s.Lable}>{props.WindowName}</span>
                </div>
                <div className={ s.ButtonPack }>
                    { props.MainButtons[0] ? 
                    <button className={ s.CollapseButton } onClick={ () => {OnClick()} }></button>
                    : <></> }
                    { props.MainButtons[1] ?     
                    <button className={ props.MainButtons[1] == 1 ? s.ExpandButton : s.ExpandButtonUseful }></button>
                    : <></> }
                    { props.MainButtons[2] ?
                    <button className={ s.SwitchOffButton } onClick={ () => {OnClick()} }></button>
                    : <></> } 
                </div>
            </div>

            <div className={s.Menu}>
                <span className={s.MenuItem}>File</span>
                <span className={s.MenuItem}>Edit</span>
                <span className={s.MenuItem}>View</span>
            </div>
        </div>
    );
}


export default Header;
